import React from "react";

const Person = () => {
  const listOfPersons = data.map((person) => {
    return (
      <div className="card" key={person.id}>
        <h3>{person.name}</h3>
        <h3>{person.job}</h3>
        <h3>{person.gender}</h3>
      </div>
    );
  });
  return <div>{listOfPersons};</div>;
};
export default Person;
